                </div>
                <div className="feature-box text-light">
                  <h3><i class="bi bi-hand-thumbs-up "></i></h3>
                  {/* <span className="icon">üëç</span> */}
                  <p>Best Quality</p>
                </div>
                <div className="feature-box text-light">
                  <h3><i class="bi bi-tags text-light"></i></h3>
                  <p>Flat Rate</p>
                </div>
                <div className="feature-box text-light">
                  <span className="icon">üìû</span>
                  <p>24/7 Available</p>
                </div>
              </div>
            </div>

          </div>
        </div>

      </section>



    </>

  );
};

export default ContactUs;



